import React, {useState, useEffect} from 'react';

function ListChannels() {
    const [channels, setChannels] = useState([]);

    async function fetchJodels() {
        const response = await fetch('http://localhost:8080/channels');
        const json = await response.json();
        setChannels(json);
    }

    useEffect(() => {fetchJodels()}, []);
    //console.log(channels);


    return(
        <div style={{backgroundColor: '#e6e7e8', }}>
            {
                channels.map((chan) => (
                    <div key={chan.channelId} style={{borderColor: '#cdcfd1', borderWidth: 2}}>
                        <h2>{chan.channelName}</h2>
                        </div>
                ))
            }
        </div>
    )
}

export default ListChannels;
